var swiper = new Swiper(".lg-page-container", {
    speed: 800,
    initialSlide: 0,
    loop: true,
    resistance: true,
    fade: {
        crossFade: true
    },
    cube: {
        slideShadows: true,
        shadow: false,
        shadowOffset: 20,
        shadowScale: .94
    },
    coverflow: {
        rotate: 50,
        stretch: 0,
        depth: 100,
        modifier: 1,
        slideShadows: true
    },
    lazyLoading: true,
    lazyLoadingInPrevNext: true,
    direction: "vertical",
    effect: "slide",
    pagination: ".swiper-pagination",
    onSetTranslate: function(t, n) {
        var a = document.querySelector(".lg-container"),
            i = "horizontal" == 'vertical' ? "x" : "y",
            r = "x" == i ? (t.slides.length - 1) * t.width : (t.slides.length - 1) * t.height;
        n > 0 ? (a.style.webkitTransition = "none", a.style.webkitTransform = "translate3d(0, " + n + "px, 0)") : -n > r ? (a.style.webkitTransition = "none", a.style.webkitTransform = "translate3d(0, " + (r + n) + "px, 0)") : (a.style.webkitTransition = "-webkit-transform .8s ease", a.style.webkitTransform = "")
    },
    onInit: function(e) {
        // n(e.activeIndex)
    },
    onProgress: function(e) {
        // n(e.activeIndex)
    },
    onSlideChangeStart: function(e) {
        // n(e.activeIndex)
    },
    onSlideChangeEnd: function(e) {
        // n(e.activeIndex)
    }
});

window.addEventListener("hashchange", function() {
    String(location.hash).replace(/\bpage=(\d+)/, function(e, t) {
        swiper.slideTo(+t)
    })
});

$(document.body).delegate('[data-link]', 'click', function(e) {
    var link = $(e.currentTarget).attr('data-link');
    if (!!link) {
        String(link).replace(/\bpage(\d+)/, function(e, t) {
            swiper.slideTo(+t)
        })
    }
});